/* Money Laundering and Child Exploitation Scandal */Re-arranged wording to be clearer.

Original wording implied that Westpac had actively participated in money laundering and child exploitation. As the article states, the reality is that 23 million transactions went through without active and retroactive monitoring and analysis, which is in violation of anti-money laundering and counter terrorism financing laws (AML/CTF laws). 

